function formatarData(dataString) {
  const data = new Date(dataString); // Converte a string em objeto Date
  if (isNaN(data)) {
    return "Data invÃ¡lida"; // Retorna se a data nÃ£o for vÃ¡lida
  }

  // Formata no padrÃ£o DD/MM/YYYY HH:mm
  const dia = String(data.getDate()).padStart(2, '0');
  const mes = String(data.getMonth() + 1).padStart(2, '0'); // MÃªs comeÃ§a em 0
